package day7;

import java.util.ArrayList;

public class EnhancedForLoopDemo {

	public static void main(String[] args) {
		// TODO Auto-generated method stub
		ArrayList<Integer> o1=new ArrayList<Integer>();
		
		o1.add(1);
		o1.add(2);
		o1.add(3);
		o1.add(4);
		o1.add(5);
		
		for(Integer i:o1)
		{
			System.out.println(i);
		}
		
		

	}

}
